I have a list of strings and I want to sort them in case-sensative way. For example, I have a list of strings like this:
var list = ["a", "A", "b", "B", "c", "C"];
I want to sort them like this:
var list = ["A", "a", "B", "b", "C", "c"];
How can I do this in javascript?
marked as duplicate by Bergi  javascript Sep 15 '15 at 15:34
You can use Array.prototype.sort() and pass a function that compares the strings in a case-sensitive way:
var list = ["a", "A", "b", "B", "c", "C"];
list.sort(function(a, b) {
  return a.toLowerCase() > b.toLowerCase() ? 1 : -1;
console.log(list);
["A", "a", "B", "b", "C", "c"]
